import arrow from '../../assets/images/Quiz/BottomSemiArrow.svg'

function QuizStep1() {
    return (
        <div className="step1">
            <h1 className="user_name">Susi</h1>
            <h2>CUÉNTANOS SOBRE TI.</h2>
            <h3>100% CONFIDENCIAL</h3>
            <p className="paragraph1">Mientras más honestas sean tus respuestas, más acertada será la personalización de tus productos. </p>
            <img src={arrow}/>
        </div>
    )
}

export default QuizStep1
